import React from "react";

function SearchList({ results, onAdd, handleAddToDecklist }) {
    const goodResults = results.filter(result => result.imageUrl)
    return (<div>
        {goodResults.map((cardData, index)=> {

            const commandLegal = cardData.legalities.filter(legality => legality.format==="Commander")
            return(
            <ul key={index}>
                <li>
                    <img alt={`${cardData.name}`} src={`${cardData.imageUrl}`} onClick={onAdd}/>
                    <p>Set: {cardData.setName}</p>
                    <p>Format: {commandLegal[0].format}</p>
                    <p>Legality: {commandLegal[0].legality}</p>
                </li>
            </ul>
        )})}
    </div>)
}

export default SearchList
